import {createBrowserRouter} from 'react-router-dom'
import Main from '../pages/main'
import Home from '../pages/home'
import Mall from '../pages/mall'
import User from '../pages/user'


const routes =[
    {
        path:'/',
        element: <Main />,
        children: [
            {
                path: 'home',
                element: <Home />
            },
            {
                path: 'mall',
                element: <mall />
            },
            {
                path: 'user',
                element: <User />
            }
        ]
    }
]

export default createBrowserRouter(routes)
